const getRoleName = (role_name: string, location?: string) => {
  switch (role_name) {
    case 'Event Server':
    case 'Events Server':
    case 'Server': { //Server pool
      role_name = 'Server';
      break;
    }
    case 'Event Bartender':
    case 'Events Bartender':
    case 'Bartender': { //Bartender pool
      role_name = 'Bartender';
      break;
    }
    case 'Event Busser':
    case 'Busser':
    case 'Event Runner':
    case 'Runner': {
      if (location !== "Delilah Miami") {
        role_name = 'Support';
      }
      break;
    }
    case 'Host':
    case 'Events Reception':
    case 'Event Reception':
    case 'Reception':
    case 'Receptionist': {
      role_name = 'Host';
      break;
    }
    case 'Barback':
    case 'Event Barback': {
      role_name = 'Barback';
      break;
    }
  }
  return role_name;
}

